public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=1;
		
		switch(a) {
		case 1: System.out.println("working"); break;
		case 2: System.out.println("not working"); break;
		case 3: System.out.println("not working"); break;
		default: System.out.println("may be");
		}

	}

}
